#[\uFFFD\u01F1\uFFFD\uFFFD\uFFFD]\uFFFD\uFFFD\uFFFD\u00F5\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\u02B5\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD,\u012C\uFFFD\uFFFDQuartzSchedulerorg.quartz.scheduler.instanceName=rcms-quartz-scheduler#[\uFFFD\u01F1\uFFFD\uFFFD\uFFFD]\uFFFD\uFFFD\uFFFD\u00F5\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\u02B5\uFFFD\uFFFDID,\u012C\uFFFD\uFFFD\u05B5NON_CLUSTEREDorg.quartz.scheduler.instanceId=AUTO#[\uFFFD\uFFFD\uFFFD\uFFFD]\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\u07F3\u0333\uFFFD\u02B5\uFFFD\uFFFD\uFFFD\uFFFD(\u04BB\uFFFD\uFFFD\u02B9\uFFFD\uFFFDSimpleThreadPool\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\u07F3\u0333\uFFFD)org.quartz.threadPool.class=org.quartz.simpl.SimpleThreadPool#[\uFFFD\uFFFD\uFFFD\uFFFD]\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\u07F3\uFFFD\uFFFD\uFFFD(\uFFFD\uFFFD\u012C\uFFFD\uFFFD\u05B5,\u04BB\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\u03AA1-100\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD)org.quartz.threadPool.threadCount=5#[\uFFFD\u01F1\uFFFD\uFFFD\uFFFD]\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\u07F3\u0335\uFFFD\uFFFD\uFFFD\uFFFD\u023C\uFFFD(\uFFFD\uFFFD\uFFFD\u03AA9\uFFFD\uFFFD\uFFFD\uFFFD\u0421\u03AA1,\u012C\uFFFD\uFFFD\u03AA5)org.quartz.threadPool.threadPriority=5#[\uFFFD\u01F1\uFFFD\uFFFD\uFFFD]\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\u01F7\uFFFD\u03AA\uFFFD\u063B\uFFFD\uFFFD\u07F3\uFFFD(\u012C\uFFFD\uFFFD\u03AAtrue)org.quartz.threadPool.threadsInheritContextClassLoaderOfInitializingThread=true#[\uFFFD\u01F1\uFFFD\uFFFD\uFFFD]\uFFFD\u07F3\uFFFD\u01F0\u05FA(\u012C\uFFFD\uFFFD\u03AA\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\u02B5\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD_Worker)org.quartz.threadPool.threadNamePrefix=quartz-scheduler-thread#[\uFFFD\u01F1\uFFFD\uFFFD\uFFFD]\uFFFD\uFFFD\uFFFD\uFFFDschedule\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\u03E2\uFFFD\u6D22\uFFFD\uFFFD\uFFFD\uFFFD(\u012C\uFFFD\u03F4\u6D22\uFFFD\uFFFD\uFFFD\u06B4\uFFFD\uFFFD\uFFFD)org.quartz.jobStore.class=org.quartz.simpl.RAMJobStore#[\uFFFD\u01F1\uFFFD\uFFFD\uFFFD]\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\u0735\u0134\uFFFD\uFFFD\uFFFD\uFFFD\uFFFD\u02B1\u02B1\uFFFD\uFFFD(\u012C\uFFFD\uFFFD\u03AA60\uFFFD\uFFFD)org.quartz.jobStore.misfireThreshold=60000